package blockchain

import (
	"testing"

	"github.com/btgsuite/btgd/chaincfg"
	"github.com/btgsuite/btgd/wire"
	btcutil "github.com/btgsuite/btgutil"
)

// TestCalcNextBits ensures CalcNextBits calculates the expected bits value from values
// in last blocks based on LWMA.
func TestCalcNextBits(t *testing.T) {
	type Input struct {
		block      string
		prevBlocks []string
		config     chaincfg.LwmaConfig
	}

	type Output struct {
		err string
	}

	config := chaincfg.TestNet3Params.LWMA

	tests := []struct {
		in  Input
		out Output
	}{
		{
			in: Input{
				block: "",
				prevBlocks: []string{
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
				},
				config: config,
			},
			out: Output{
				err: "",
			},
		},
		{
			in: Input{
				block: "",
				prevBlocks: []string{
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
				},
				config: config,
			},
			out: Output{
				err: "",
			},
		},
		{
			in: Input{
				block:      "",
				prevBlocks: []string{},
				config:     config,
			},
			out: Output{
				err: "assertion failed: LWMA need the last 46 blocks to determine the next target",
			},
		},
		{
			in: Input{
				block: "",
				prevBlocks: []string{
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
					"",
				},
				config: config,
			},
			out: Output{
				err: "assertion failed: Block with height 15333 is missing, cannot calculate next target",
			},
		},
	}

	for _, test := range tests {
		bytes := hexToBytes(test.in.block)
		block, _ := btcutil.NewBlockFromBytes(bytes)

		blocks := make([]wire.BlockHeader, len(test.in.prevBlocks))

		for index, hex := range test.in.prevBlocks {
			blockBytes := hexToBytes(hex)
			prevBlock, _ := btcutil.NewBlockFromBytes(blockBytes)
			blocks[index] = prevBlock.MsgBlock().Header
		}

		header := block.MsgBlock().Header
		r, err := CalcNextBits(header.Height, header.Timestamp, blocks, &config)
		bits := block.MsgBlock().Header.Bits

		if err != nil {
			if err.Error() != test.out.err {
				t.Errorf("TestCalcNextBits test failed: error %v",
					err)
				return
			}
		} else if r != bits {
			t.Errorf("TestCalcNextBits test failed: got %v want %d",
				r, bits)
			return
		}
	}
}
